import React from 'react';
import { Link } from 'react-router-dom';
import logo from '../assets/logo.png';      // adjust path if needed
import profileIcon from '../assets/profile.png'; // adjust path if needed

function Navbar() {
  return (
    <nav className="navbar">
      {/* Logo instead of Home */}
      <Link to="/" className="nav-link">
        <img src={logo.png} alt="Logo" className="nav-icon" />
      </Link>

      <Link to="/majors" className="nav-link">
        Majors
      </Link>

      {/* Profile icon */}
      <Link to="/profile" className="nav-link">
        <img src={profile.png} alt="Profile" className="nav-icon" />
      </Link>

      <Link to="/login" className="nav-link">
        Login
      </Link>

      <Link to="/signup" className="nav-link">
        Signup
      </Link>
    </nav>
  );
}

export default Navbar;
